import React from 'react';

const FAQSection = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-[#FFFF] p-8">
      {/* Основной контейнер */}
      <div className="max-w-6xl w-full flex flex-col md:flex-row items-center gap-8">
        {/* Левая часть: Картинка */}
        <div className="flex-1">
          <img
            src="/images/placeholder-image.png" // Замените на путь к вашей картинке
            alt="Placeholder"
            className="w-full h-auto rounded-lg shadow-lg"
          />
        </div>

        {/* Правая часть: Текст и кнопки */}
        <div className="flex-1 flex flex-col space-y-8">
          {/* Заголовок */}
          <div className="text-left">
            <h1 className="text-4xl font-bold text-gray-800 mb-4">Frequently Asked Questions</h1>
            <h2 className="text-2xl text-gray-600">You’ve Any Questions</h2>
          </div>

          {/* Две кнопки */}
          <div className="space-y-6">
            {/* Первая кнопка */}
            <button className="w-full text-left p-4 bg-white rounded-lg shadow-md hover:shadow-lg transition duration-300">
              <h3 className="text-xl font-bold text-gray-800">World’s hottest destinations for vegans</h3>

            </button>

            {/* Вторая кнопка */}
            <button className="w-full text-left p-4 bg-white rounded-lg shadow-md hover:shadow-lg transition duration-300">
              <h3 className="text-xl font-bold text-gray-800">Let’s grow naturaly and live naturaly</h3>

            </button>
          </div>



          {/* Секция с заголовком и текстом */}
          <button className="w-full text-left p-4 bg-white rounded-lg shadow-md hover:shadow-lg transition duration-300">
              <h3 className="text-xl font-bold text-gray-800">Best vegetables for your healthy hair</h3>

            </button>
          </div>
        </div>
      </div>

  );
};

export default FAQSection;
